import React, { useEffect } from "react";
import "./Rules.css";

function Gallery() {
  useEffect(() => {
    // Ta bort eventuell tidigare instans för säkerhet
    const oldScript = document.getElementById("elfsight-script");
    if (oldScript) oldScript.remove();

    // Skapa scriptet
    const script = document.createElement("script");
    script.id = "elfsight-script";
    script.src = "https://elfsightcdn.com/platform.js";
    script.async = true;

    // Lägg till i body
    document.body.appendChild(script);

    // Return för att städa upp om komponenten tas bort
    return () => {
      document.body.removeChild(script);
    };
  }, []);

  return (
    <div style={{ padding: "20px" }}>
      <h1>Galleri</h1>
      <div class="rules-container text-break" style={{ padding: "20px" }}>
        <p>Här kan du se de senaste inläggen från vårt Instagram-konto:</p>

        {/* Instagram-widget */}
        <div
          class="elfsight-app-8572ff3f-df8a-48c3-af33-b46265359cbd"
          data-elfsight-app-lazy
        ></div>
      </div>
    </div>
  );
}

export default Gallery;
